import Navbar from './navbar';
import { Link } from 'react-router-dom';
const Header = () => {
	return (
		<header className='header'>
			<div className='header-grid'>
				<div className='header__left'>
					<Link to='/'>
						<img src='/assets/images/logo.png' alt='logo' />
					</Link>
				</div>
				<Navbar />
			</div>
		</header>
	);
};

export default Header;
